import React from "react";
import Slider from "react-slick";
import ava01 from "../../assets/images/ava-1.jpg";
import ava02 from "../../assets/images/ava-2.jpg";
import ava03 from "../../assets/images/ava-3.jpg";

const Testimonials = () => {
  return (
    <Slider>
      <div className="testimonial py-4 px-3"></div>
      <p>
        Lorem ipsum, dolor sit amet consectetur adipisicing elit. Ut, ratione
        saepe! Laboriosam, libero sunt illo quia perferendis hic, illum officiis
        provident quae nihil mollitia delectus maxime eum. Tempora, illo
        veritatis.
      </p>

      <div className="d-flex align-items-center gap-4 mt-3">
        <img src={ava01} className="w-25 h-25 rounded-2" alt="" />
        <div>
            <h5 className="mb-0 mt-3">John Doe</h5>
            <p>Customer</p>
        </div>
      </div>
    </Slider>
  );
}

export default Testimonials;
